pub fn get_spell_power(id: u32) -> Option<&'static [SpellPowerCost]> {
    SPELL_POWER_DB.get(&id).copied()
}

pub fn power_type_name(power_type: i8) -> &'static str {
    match power_type {
        -2 => "HEALTH",
        0 => "MANA",
        1 => "RAGE",
        2 => "FOCUS",
        3 => "ENERGY",
        4 => "COMBO_POINTS",
        5 => "RUNES",
        6 => "RUNIC_POWER",
        7 => "SOUL_SHARDS",
        8 => "LUNAR_POWER",
        9 => "HOLY_POWER",
        10 => "ALTERNATE_POWER",
        11 => "MAELSTROM",
        12 => "CHI",
        13 => "INSANITY",
        17 => "FURY",
        19 => "ESSENCE",
        _ => "MANA",
    }
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn test_flash_of_light_power_cost() {
        let costs = get_spell_power(19750).expect("Flash of Light should have power cost");
        assert!(!costs.is_empty());
        assert_eq!(costs[0].power_type, 0); // MANA
    }

    #[test]
    fn test_spell_power_count() {
        assert!(SPELL_POWER_DB.len() > 5000);
    }

    #[test]
    fn test_no_power_for_unknown() {
        assert!(get_spell_power(999_999_999).is_none());
    }
}
